import { useState } from 'react';
import { useHistory } from 'react-router-dom';

function HeadNav() {
  const history = useHistory();
  const [AdminDtl, setAdminDtl] = useState({ FirstName: "Ritesh", LastName: "Padalwar" });

  const Logout = () => {
    history.push('/Logout');
  };

  const GiveFeedback = () => {
    history.push("/GiveFeedback");
  };

  const Profile = () => {
    history.push("/Profile");
  };

  const AboutUs = () => {
    history.push("/AboutUs");
  };

  const Home = () => {
    history.push("/LoggedIn");
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-light bg-light">
      <div className="container">
        <a className="navbar-brand" href="#">Project KYC</a>
        <button
          className="navbar-toggler"
          type="button"
          data-bs-toggle="collapse"
          data-bs-target="#navbarNav"
          aria-controls="navbarNav"
          aria-expanded="false"
          aria-label="Toggle navigation"
        >
          <span className="navbar-toggler-icon"></span>
        </button>
        <div className="collapse navbar-collapse" id="navbarNav">
          <ul className="navbar-nav me-auto">
            <li className="nav-item">
              <button className="btn btn-danger" onClick={Home}>
                Home
              </button>
            </li>
            <li className="nav-item">
              <button className="btn btn-danger" onClick={GiveFeedback}>
                Feedback
              </button>
            </li>
            <li className="nav-item">
              <button className="btn btn-danger" onClick={Profile}>
                Profile
              </button>
            </li>
            <li className="nav-item">
              <button className="btn btn-danger" onClick={AboutUs}>
                About Us
              </button>
            </li>
          </ul>
          <ul className="navbar-nav">
            <li className="nav-item">
              <a
                className="btn btn-danger"
                href="https://www.kychub.com/contact-us/"
                target="_blank"
                rel="noopener noreferrer"
              >
                Contact Us
              </a>
            </li>
            <li className="nav-item">
              <a
                className="btn btn-danger"
                href="https://paytm.com/helpinghand/breakthrough-trust"
                target="_blank"
                rel="noopener noreferrer"
              >
                Contribute Us
              </a>
            </li>
            <li className="nav-item">
              {AdminDtl.FirstName} {AdminDtl.LastName}
              <button
                onClick={Logout}
                className="btn btn-danger ml-2"
              >
                Logout
              </button>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
}

export default HeadNav;
